const HexagonShape = styled.div`
	float: left;
    margin-right: -26px;
    margin-bottom: -50px;
    width: ${props => props.image.true ? 10 : 5} px;
`;

export default function Hexagon(props) {
	return <HexagonShape>{props.children}</HexagonShape>;
}
